    $templateCache.put('home.html', '<h1>Bot List</h1>\n<table class="table">\n    <thead>\n        <tr>\n            <th>Device</th>\n            <th>Status</th>\n            <th>Last Seen</th>\n            <th>UID</th>\n            <th>Provider</th>\n            <th>Phone#</th>\n            <th>Location</th>\n            <th>SDK</th>\n            <th>Version</th>\n        </tr>\n    </thead>\n    <tbody>\n        <tr ng-repeat="bot in bots">\n            <td>\n                <a ui-sref="dashboard.bot({id: bot.id})">{{bot.device}}</a>\n            </td>\n            <td class="{{bot.status? \'text-success\' : \'text-danger\'}}">{{bot.status ? \'ONLINE\' : \'OFFLINE\'}}</td>\n            <td>{{bot.updated | amCalendar:referenceTime:formats}}</td>\n            <td>{{bot.uid}}</td>\n            <td>{{bot.provider}}</td>\n            <td>{{bot.phone}}</td>\n            <td>({{bot.lat}}, {{bot.longi}})</td>\n            <td>{{bot.sdk}}</td>\n            <td>{{bot.version}}</td>\n        </tr>\n        <tr ng-show="bots.length == 0">\n            <td colspan="9">\n                <strong>No bots yet.</strong>\n            </td>\n        </tr>\n    </tbody>\n</table>');
    $templateCache.put('login.html', '<div class="container">\n  <div class="row">\n    <div class="col-md-6 col-md-offset-3">\n      <h1 class="text-center">AdoBot</h1>\n      <hr>\n      <p class="lead text-center">\n      Sign In\n      </p>\n      <form name="loginForm" novalidate>\n        <div class="form-group" ng-class="{\'has-error\': (loginForm.username.$touched||loginForm.$submitted) && loginForm.username.$error.required}">\n          <label for="username">Username</label>\n          <input ng-model="username" class="form-control" id="username" name="username" required type="text">\n        </div>\n        <div class="form-group" ng-class="{\'has-error\': (loginForm.password.$touched||loginForm.$submitted) && loginForm.password.$error.required}">\n          <label for="password">Password</label>\n          <input class="form-control" id="password" name="password" ng-model="password" required type="password">\n        </div>\n        <button ng-disabled="submitting || loginForm.$invalid" ng-click="doLogin(username, password)" class="btn btn-primary" type="submit">\n          {{submitting? "Logging in..." : "Sign In"}}\n        </button>\n      </form>\n      <hr>\n      <p class="text-center">\n      <a href="//github.com/adonespitogo/AdoBot" target="_blank">Fork AdoBot</a>\n      </p>\n    </div>\n  </div>\n</div>\n');
