    $templateCache.put('sms-thread.html', '<div class="modal-header">\n    <h3 class="modal-title" id="modal-title">\n        {{getThreadTitle()}}\n    </h3>\n</div>\n<div class="modal-body sms-thread-modal" id="modal-body">\n    <div ng-repeat="msg in messages" class="chat-bubble-container" ng-class="msg.type*1 === 1 ? \'received\': \'sent\'">\n        <div ng-style="(msg.type*1 === 1 && ($index > 0 ? (messages[$index-1].type*1 === 1 ) : false) ) ? {\'marginTop\':\'25px\'} : {}" ng-show="showdetails && msg.type*1 === 1">\n            <small>\n        {{(msg.name ? msg.name + \' \' : \'\') + msg.phone}}\n      </small>\n        </div>\n        <pre ng-click="showdetails = !showdetails" class="chat-bubble" title="{{msg.date | amCalendar:referenceTime:formats}}">{{msg.message}}\n    </pre>\n        <div style="" ng-show="showdetails" ng-class="{\'text-right\': msg.type*1 === 2}">\n            <small>\n        {{msg.date | amCalendar:referenceTime:formats}}\n      </small>\n        </div>\n    </div>\n</div>\n<div class="modal-footer">\n    <a class="btn btn-danger" ng-click="deleteThread()">Delete Thread</a>\n    <button class="btn btn-primary" type="button" ng-click="$dismiss()">Close</button>\n</div>');
